import React from 'react';
import Stack from '@mui/material/Stack';
import './DataCenter.css'


function DataMaster(){
    return(
        <div>
            <DataFaceDetection/>
            <DataPanels/>
        </div>
    )
}
function DataFaceDetection(){
    return(
        <div style={{textAlign: 'center'}}>
            <p style={{fontSize: '26px'}}>Relevant Faces Detected</p>
        </div>
    )
}
function DataPanels(){
    return(
    <Stack direction="column" justifyContent="center" alignItems="center">
    <div className="buttonParent">
    <p className="button" style={{fontSize: '22px'}}>Relevant Faces Detected</p>
    </div>   
    </Stack>)
}
export default DataMaster;
